import React from "react";

import BarCharts from "../BarCharts";
import SideBar from "../SiderBar";

// import ColumnCharts from "../ColumnCharts/index";
import "./index.css";

function Dashboard() {
  return (
    <Box
      sx={{
        display: "flex",
        flexDirection: "row",
        justifyContent: "",
        alignContent: "center",
        height: "100vh",
        width: "100vw",
      }}
    >
      <SideBar />
      <BarCharts />
    </Box>
  );
}

export default Dashboard;
